export default function Header(){
  return (
    <header className="sticky top-0 bg-white/75 backdrop-blur z-40 border-b">
      <div className="max-w-6xl mx-auto px-4 py-3 flex items-center justify-between">
        <div className="text-2xl font-extrabold text-strong tracking-tight">Mummy's Beauty Parlor</div>
        <nav className="space-x-4 text-gray-600 hidden md:block">
          <a href="#home" className="hover:text-accent-light">Home</a>
          <a href="#services" className="hover:text-accent-light">Services</a>
          <a href="#contact" className="hover:text-accent-light">Contact</a>
        </nav>
      </div>
    </header>
  );
}
